      children: "6. \u0414\u043B\u044F \u043F\u0435\u0440\u0435\u043A\u043B\u044E\u0447\u0435\u043D\u0438\u044F \u0438 \u043C\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0446\u0438\u0438 \u0441\u0442\u0440\u0430\u043D\u0438\u0446 \u043F\u0440\u0438\u043D\u044F\u0442\u043E \u0440\u0435\u0448\u0435\u043D\u0438\u0435 React Router (\u043F\u043E \u0441\u0443\u0442\u0438 \u0434\u0435\u043B\u0430 \u044D\u0442\u043E \u0438 \u0431\u044B\u043B\u043E \u0437\u0430\u0434\u0430\u043D\u0438\u0435\u043C \u043F\u0440\u043E\u0435\u043A\u0442\u0430 \u043F\u043E \u0437\u0430\u0432\u0435\u0440\u0448\u0435\u043D\u0438\u044E \u043E\u0431\u0443\u0447\u0435\u043D\u0438\u044F). \u0414\u043B\u044F \u0441\u043E\u0437\u0434\u0430\u043D\u0438\u044F \u044D\u0442\u043E\u0433\u043E \u0432\u0435\u0431-\u043F\u0440\u0438\u043B\u043E\u0436\u0435\u043D\u0438\u044F \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u043B\u0441\u044F react-router-dom, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u0432\u043A\u043B\u044E\u0447\u0430\u0435\u0442 \u0432 \u0441\u0435\u0431\u044F \u0432\u0441\u0435, \u0447\u0442\u043E \u0435\u0441\u0442\u044C \u0432 react-router, \u0438 \u0434\u043E\u0431\u0430\u0432\u043B\u044F\u0435\u0442 \u043D\u0435\u0441\u043A\u043E\u043B\u044C\u043A\u043E \u0441\u043F\u0435\u0446\u0438\u0444\u0438\u0447\u043D\u044B\u0445 \u0434\u043B\u044F DOM API \u043A\u043E\u043C\u043F\u043E\u043D\u0435\u043D\u0442\u043E\u0432, \u0432\u043A\u043B\u044E\u0447\u0430\u044F BrowserRouter \u0438 Link. \u041F\u0440\u0438\u043B\u043E\u0436\u0435\u043D\u0438\u0435 \u0438\u043C\u0435\u0435\u0442 \u043E\u0434\u0438\u043D BrowserRouter, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u043E\u0431\u0435\u0440\u0442\u044B\u0432\u0430\u0435\u0442 \u043F\u044F\u0442\u044C Routes (\u043F\u0443\u043D\u043A\u0442\u043E\u0432 \u043C\u0435\u043D\u044E). BrowserRouter \u0438 Routes \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u0443\u044E\u0442\u0441\u044F \u0434\u043B\u044F \u043E\u043F\u0440\u0435\u0434\u0435\u043B\u0435\u043D\u0438\u044F \u043C\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043E\u0440\u0430. \u041A\u043E\u0433\u0434\u0430 URL-\u0430\u0434\u0440\u0435\u0441 \u0441\u043E\u043E\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0443\u0435\u0442 \u043F\u0443\u0442\u0438, \u043D\u0430\u043F\u0440\u0438\u043C\u0435\u0440: \u0414\u0438\u0430\u0444\u0440\u0430\u0433\u043C\u0430, \u043F\u0440\u0438\u043B\u043E\u0436\u0435\u043D\u0438\u0435 \u043F\u043E\u043A\u0430\u0437\u044B\u0432\u0430\u0435\u0442 \u043A\u043E\u043C\u043F\u043E\u043D\u0435\u043D\u0442 \u0414\u0438\u0430\u0444\u0440\u0430\u0433\u043C\u0430 \u0438\u043B\u0438, \u043D\u0430\u043F\u0440\u0438\u043C\u0435\u0440: \u0412\u044B\u0434\u0435\u0440\u0436\u043A\u0430, \u043F\u0440\u0438\u043B\u043E\u0436\u0435\u043D\u0438\u0435 \u043F\u043E\u043A\u0430\u0437\u044B\u0432\u0430\u0435\u0442 \u043A\u043E\u043C\u043F\u043E\u043D\u0435\u043D\u0442 \u0412\u044B\u0434\u0435\u0440\u0436\u043A\u0430. \u041D\u0430\u0432\u0438\u0433\u0430\u0446\u0438\u0438 \u043F\u043E \u0441\u0441\u044B\u043B\u043A\u0435, \u043A\u043E\u0442\u043E\u0440\u0430\u044F \u0443\u0441\u0442\u0430\u043D\u0430\u0432\u043B\u0438\u0432\u0430\u0435\u0442\u0441\u044F Link, \u043E\u0442\u043E\u0431\u0440\u0430\u0436\u0430\u0435\u0442 \u0434\u043E\u0441\u0442\u0443\u043F\u043D\u044B\u0439 \u044D\u043B\u0435\u043C\u0435\u043D\u0442 \u043C\u0430\u0440\u0448\u0440\u0443\u0442\u0430 \u0441 \u0440\u0435\u0430\u043B\u044C\u043D\u044B\u043C href, \u0443\u043A\u0430\u0437\u044B\u0432\u0430\u044E\u0449\u0438\u043C \u043D\u0430 \u0440\u0435\u0441\u0443\u0440\u0441, \u043D\u0430 \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u043E\u043D \u0441\u0441\u044B\u043B\u0430\u0435\u0442\u0441\u044F. \u041A\u043B\u0438\u043A \u043F\u043E \u0441\u0441\u044B\u043B\u043A\u0435 \u0443\u0441\u0442\u0430\u043D\u0430\u0432\u043B\u0438\u0432\u0430\u0435\u0442 URL-\u0430\u0434\u0440\u0435\u0441. \u041F\u0440\u0438 \u044D\u0442\u043E\u043C \u0441\u0442\u0440\u0430\u043D\u0438\u0446\u0430 \u043D\u0435 \u043F\u0435\u0440\u0435\u0433\u0440\u0443\u0436\u0430\u0435\u0442\u0441\u044F, \u0430 \u043E\u0442\u043E\u0431\u0440\u0430\u0436\u0430\u0435\u0442\u0441\u044F \u043A\u043E\u043C\u043F\u043E\u043D\u0435\u043D\u0442 \u043F\u043E \u0441\u0441\u044B\u043B\u043A\u0435. \u041C\u043D\u0435 \u043A\u0430\u0436\u0435\u0442\u0441\u044F \u044D\u0442\u043E \u0431\u043E\u043B\u0435\u0435 \u0441\u043E\u0432\u0440\u0435\u043C\u0435\u043D\u043D\u044B\u0439 \u0438 \u0443\u0434\u043E\u0431\u043D\u044B\u0439 \u0432\u0430\u0440\u0438\u0430\u043D\u0442, \u0447\u0435\u043C \u043F\u0440\u043E\u0441\u0442\u0430\u044F \u0437\u0430\u0433\u0440\u0443\u0437\u043A\u0430 \u043F\u044F\u0442\u0438 \u043B\u0438\u0441\u0442\u043E\u0432 HTML, \u0445\u043E\u0442\u044F \u0438 \u0431\u043E\u043B\u0435\u0435 \u0441\u043B\u043E\u0436\u043D\u044B\u0439 \u0432 \u0440\u0435\u0430\u043B\u0438\u0437\u0430\u0446\u0438\u0438. \u041D\u043E \"\u044D\u0442\u043E \u0442\u043E\u0433\u043E \u0441\u0442\u043E\u0438\u0442\"."
